(
A
) Coronal section computed tomography angiography showing hypodense hematoma extending along the right side of the aorta from the D10 to L1 level with active contrast extravasation (later diagnosed to be collaterals). Also, loculated right pleural effusion is noted. (
B
) Axial cut section showing the same lesion receiving collaterals from the adjacent aorta.
